import React from 'react'

const MealPlanWeekResults = ({food}) => {

    // criar um novo array de objetos 
    const foodList = food.map(seila => {
        return seila.day
    })
    const mealsList = food.items.map(meal => {
        const objParsed = JSON.parse(meal.value)
        const title = objParsed.title
        const id = objParsed.id
        
        return (
            <div className="mealResultContainer" key={id}>
                { title }
            </div>
        )
    })

    return (
        <>
            { mealsList }
        </>
    )
}

export default MealPlanWeekResults
